import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import WelcomeCard from "./components/WelcomeCard";
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
    <h2>AATHITYAN MARIRAJ</h2>
    <WelcomeCard/>
    <h2>Test</h2>
    <WelcomeCard/>
  </React.StrictMode>
);
